package com.ziyue.niuke.hw;

import java.util.Scanner;

public class HJ080 {
    public static void main(String args[]) {
        Scanner scanner = new Scanner(System.in);
        while (scanner.hasNextLine()) {
            int      arrALen  = Integer.parseInt(scanner.nextLine().trim());
            String[] arrA     = scanner.nextLine().trim().split(" ");
            int      arrBLen  = Integer.parseInt(scanner.nextLine().trim());
            String[] arrB     = scanner.nextLine().trim().split(" ");
            int      indexA   = 0;
            int      indexB   = 0;
            String pre = null;
            StringBuilder stringBuilder = new StringBuilder();
            while (indexA < arrALen || indexB < arrBLen) {
                if (indexA >= arrALen) {
                    if (!(arrB[indexB]).equals(pre))  {
                        stringBuilder.append(arrB[indexB]);
                        pre = arrB[indexB];
                    }
                    indexB ++;
                } else if (indexB >= arrBLen) {
                    if (!arrA[indexA].equals(pre)) {
                        stringBuilder.append(arrA[indexA]);
                        pre =arrA[indexA];
                    }
                    indexA ++;
                } else {
                    int a = Integer.parseInt(arrA[indexA]);
                    int b = Integer.parseInt(arrB[indexB]);
                    if (a > b) {
                        if (!(b + "").equals(pre)) {
                            stringBuilder.append(b);
                            pre = b + "";
                        }
                        indexB++;
                    } else {
                        if (!(a+"").equals(pre)) {
                            stringBuilder.append(a);
                            pre = a + "";
                        }
                        indexA++;
                    }
                }
            }
            System.out.println(stringBuilder);
        }
    }
}





